const FormSearch = () => {

  state = {
    searchText: ''
  }

  const styles = {
    form: {
      marginRight: '2rem'
    },
    input: {
      height: '2.5rem',
      width: '17rem',
      marginTop: '1.3rem'
    }
  }

  return (
    <form style={styles.form}>
      <input type="search" placeholder="search" style={styles.input} />
    </form>
  );
}

export default FormSearch;
